  return(
    <div>
      <div className="footer">
        <img className="col" src={icon}/>
        <p className="col handlee-regular">vicki@fakeemail.com</p>
        <p className="col handlee-regular">(352) 290-2038</p>
      </div>
    </div>
  )
}
